import React from "react";
import Card from "./Card";
import Certificate_1 from "./assets/certif-1.png";
import Certificate_2 from "./assets/certif-2.png";
import Certificate_3 from "./assets/certif-3.png";




const Certif=()=>{
    return(
      <>
      <div className="container">
     <Card imgsrc={Certificate_1} title="pic1"/>
     <Card imgsrc={Certificate_2} title="pic2"/>
      </div>
      
      <div className="container">
     <Card imgsrc={Certificate_3} title="pic3"/>
      </div>


      </>
    );
}
export default Certif;
